import React from "react";
import Accordion from "./Accordion";
import "./components.css";
import FullScreenNav from "./FullScreenNav";
import SearchMenu from "./SearchMenu";
import Tabs from "./Tabs";

function Home() {
  return (
    <div className="home">
      <Accordion />
      <hr />

      <Tabs />
      <hr />
      <SearchMenu />
      <hr />
      <FullScreenNav />
      <hr />
    </div>
  );
}

export default Home;
